function isLoggedIn(){return $('body').hasClass('is-logged-in ');}
function getModalReferer(){return $('.user-modal').data('referer');}
function homeUrl(){return $('meta[name=baseurl]').attr('content');}
function csrfToken(){return $('meta[name=csrf]').attr('content');}
function escapeHtml(unsafe){return unsafe.replace(/&/g,"&amp;").replace(/</g,"&lt;").replace(/>/g,"&gt;").replace(/"/g,"&quot;").replace(/'/g,"&#039;");}
function onlyAllowNumber(e){var key=e.charCode||e.keyCode||0;if(key==8||key==9||key==13||key==46||key==110||key==190||(key>=35&&key<=40)||(key>=48&&key<=57)||(key>=96&&key<=105)){return true;}else{return false;}}
function sortByKey(array,key){return array.sort(function(a,b){var x=a[key];var y=b[key];return((x<y)?-1:((x>y)?1:0));});}
function sortByKeyDesc(array,key){return array.sort(function(a,b){var x=a[key];var y=b[key];return((x>y)?-1:((x<y)?1:0));});}
function isEmptyObject(object){for(name in object){return false;}
return true;}
function confettiParty(){for(var i=0;i<250;i++){createConfetti(i);}}
function createConfetti(i){var width=Math.random()*8;var height=width*0.4;var colourIdx=Math.ceil(Math.random()*3);var colour="red";switch(colourIdx){case 1:colour="green";break;case 2:colour="purple";break;default:colour="red";}
$('<div class="confetti-'+i+' '+colour+'"></div>').css({"width":width+"px","height":height+"px","top":-Math.random()*20+"%","left":Math.random()*100+"%","opacity":Math.random()+0.5,"transform":"rotate("+Math.random()*360+"deg)"}).appendTo('.party-wrapper');dropConfetti(i);}
function dropConfetti(x){$('.confetti-'+x).animate({top:"100%",left:"+="+Math.random()*15+"%"},Math.random()*3000+3000,function(){resetConfetti(x);});}
function resetConfetti(x){$('.confetti-'+x).animate({"top":-Math.random()*20+"%","left":"-="+Math.random()*15+"%"},0,function(){dropConfetti(x);});}
function validateMaxLength(ele){var $this=$(ele);var text=$this.val();var maxlength=$this.data('maxlength');if(maxlength>0){var charsLeft=maxlength-text.length>0?maxlength-text.length:0;if(charsLeft==0){$('.chars-left',$this.parent()).parent().addClass('error');}else{$('.chars-left',$this.parent()).parent().removeClass('error');}
charsLeft+=charsLeft==1?" character":" characters";$('.chars-left',$this.parent()).text(charsLeft);$this.val(text.substr(0,maxlength));}}
function validateNumerals(s){var rgx=/^\d+$/;return s.match(rgx);}
function showPreloader($ele,loadingText='',width=25,height=25,forceCenter=true,inlineText=false){if(!$('.preloader-icon.tmp',$ele.parent()).length){var styles='width: '+width+'px; height: '+height+'px; ';if(height<40){styles+='min-height: 0; ';}
if(forceCenter){styles+='display: block; margin: 0 auto; ';}
var preloader='<div class="preloader-icon tmp" style="'+styles+'"></div>';if(loadingText!=''){var textStyles=inlineText?'margin-left: 10px;':'margin-top: 10px;';if(forceCenter){textStyles+=' text-align: center;';}
preloader+='<div class="preloader-text tmp" style="'+textStyles+'">'+loadingText+'</div>';}
$ele.after(preloader);}}
function removePreloader($ele){$('.preloader-icon.tmp, .preloader-text.tmp',$ele).remove();}
