let isControlKeyPressed=function(event){return navigator.platform.match("Mac")?event.metaKey:event.ctrlKey;}
function degreeToAngle(degree){let angle=degree-90;if(angle<0){angle+=360;}
return angle;}
function angleToDegree(angle){let degree=angle+90;if(degree>=360){degree-=360;}
return degree;}
